import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import "@material-ui/core";
import "@material-ui/icons";
import BathtubOutlinedIcon from "@material-ui/icons/BathtubOutlined";
import SquareFootOutlinedIcon from "@material-ui/icons/SquareFootOutlined";
import house1 from "./img/house1.jpg";
import house2 from "./img/house2.jpg";
import house3 from "./img/house3.jpg";
import house4 from "./img/house4.jpg";
import house5 from "./img/house5.jpg";
import house6 from "./img/house6.jpg";
import house7 from "./img/house7.jpg";
import house8 from "./img/house8.jpg";
import house9 from "./img/house9.jpg";
import house10 from "./img/house10.jpg";
import house11 from "./img/house11.jpg";
import house12 from "./img/house12.jpg";
import house13 from "./img/house13.jpg";
import house14 from "./img/house14.jpg";
import house15 from "./img/house15.jpg";
import house16 from "./img/house16.jpg";
import { Avatar } from "@material-ui/core";
import agent1 from "./img/agent1.jpg";
import agent2 from "./img/agent2.jpg";
import agent3 from "./img/agent3.jpg";
import agent4 from "./img/agent4.jpg";
import { CheckBoxOutlineBlankOutlined, Hotel } from "@material-ui/icons";
import CardSingle from "./CardSingle";
import Fade from "react-reveal/Fade";
import apt1 from "./img/apartment1.jpg";
import apt2 from "./img/apartment2.jpg";
import apt3 from "./img/apartment3.jpg";

function LandingPageApts(props) {
  return (
    <div className="lp_apts">
      <div className="lp_apts_flex">
        <CardSingle
          cardImg={apt1}
          agentImg={agent1}
          cardTitle="Apartment on Lorem Ave"
          address="555 Lorem Avenue, Lorem, PA 12345, USA"
          cardPrice="$1400 / mo"
          bedrooms="2"
          bathrooms="1"
          sqft="1400 Sq Ft"
          cardimgalt="apartment"
          featured="Featured"
          forsale="For Rent"
          filteritem="apartment agent1"
          propertyprice="p7"
          salerent="For Rent"
          aplink="/AgentJohnProfile"
        />
        <CardSingle
          cardImg={apt2}
          agentImg={agent4}
          cardTitle="Villa on Lorem Street"
          address="555 Lorem Avenue, Lorem, PA 12345, USA"
          cardPrice="$1450 / mo"
          bedrooms="2"
          bathrooms="2"
          sqft="1650 Sq Ft"
          cardimgalt="apartment"
          featured="Featured"
          forsale="For Rent"
          filteritem="apartment agent4"
          propertyprice="p13"
          salerent="For Rent"
          aplink="/AgentMaryProfile"
        />
        <CardSingle
          cardImg={apt3}
          agentImg={agent3}
          cardTitle=""
          address="555 Lorem Avenue, Lorem, PA 12345, USA"
          cardPrice="$1200 / mo"
          bedrooms="1"
          bathrooms="1"
          sqft="1200 Sq Ft"
          cardimgalt="apartment"
          featured="Featured"
          forsale="For Rent"
          filteritem="apartment agent3"
          propertyprice="p8"
          salerent="For Rent"
          aplink="/AgentKevinProfile"
          plink="/AptInAllentown"
        />
      </div>
    </div>
  );
}

export default LandingPageApts;
